import React from 'react';
import { TextField, Button, Paper } from '@mui/material';

export default function Form() {
    return (
        <Paper>
            <div className="">
                <TextField variant="standard" label="Username" />
                <Button variant="outlined">
                    Add to list
                </Button>
            </div>
        </Paper>
    );
}
